import './product-item.styles.css';

const ProductItem = () => (
  <div className="product-infor">
    <img
      width={100}
      height={100}
      alt=" PRODUCT"
      src="https://i.pinimg.com/736x/26/58/b1/2658b16da86d5427f65ad2476739734b.jpg"
    />
    <div className="product-title">
      <h2>Patient Ninja</h2>
      <p style={{ fontSize: '24px' }}>35$</p>
    </div>
  </div>
);

export default ProductItem;
